// SPDX-License-Identifier: NONE
pragma solidity ^0.8.0;

contract DigimonMarketplace {
    // Events
    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);
    event Approval(address indexed owner, address indexed approved, uint256 indexed tokenId);
    event NFTListed(uint256 indexed tokenId, address indexed seller, uint256 price);
    event NFTSold(uint256 indexed tokenId, address indexed buyer, uint256 price);

    // NFT structure
    struct NFT {
        uint256 id;
        string tokenURI;
        address owner;
    }

    struct Listing {
        address seller;
        uint256 price;
    }

    // State variables
    uint256 private _tokenCounter;
    mapping(uint256 => NFT) private _nfts;
    mapping(uint256 => address) private _tokenApprovals;
    mapping(address => uint256[]) private _ownedTokens;
    mapping(uint256 => Listing) public listings;

    // Modifiers
    modifier onlyOwner(uint256 tokenId) {
        require(_nfts[tokenId].owner == msg.sender, "You are not the owner");
        _;
    }

    // Mint a new NFT
    function mintNFT(string memory tokenURI) public {
        uint256 tokenId = ++_tokenCounter;

        _nfts[tokenId] = NFT({
            id: tokenId,
            tokenURI: tokenURI,
            owner: msg.sender
        });

        _ownedTokens[msg.sender].push(tokenId);

        emit Transfer(address(0), msg.sender, tokenId);
    }

    // Transfer NFT
    function transferFrom(address from, address to, uint256 tokenId) public {
        require(from == _nfts[tokenId].owner, "Invalid owner");
        require(
            msg.sender == from || msg.sender == _tokenApprovals[tokenId],
            "Not authorized"
        );

        _removeTokenFromOwner(from, tokenId);
        _addTokenToOwner(to, tokenId);

        _nfts[tokenId].owner = to;

        emit Transfer(from, to, tokenId);
    }

    // Approve an address to transfer the NFT
    function approve(address to, uint256 tokenId) public onlyOwner(tokenId) {
        _tokenApprovals[tokenId] = to;
        emit Approval(msg.sender, to, tokenId);
    }

    // List NFT for sale
    function listForSale(uint256 tokenId, uint256 price) public onlyOwner(tokenId) {
        require(price > 0, "Price must be greater than zero");

        listings[tokenId] = Listing({
            seller: msg.sender,
            price: price
        });

        emit NFTListed(tokenId, msg.sender, price);
    }

    // Buy a listed NFT
    function buyNFT(uint256 tokenId) public payable {
        Listing memory listing = listings[tokenId];
        require(listing.price > 0, "NFT not for sale");
        require(msg.value >= listing.price, "Insufficient payment");

        // Transfer funds to the seller
        payable(listing.seller).transfer(msg.value);

        // Transfer ownership
        transferFrom(listing.seller, msg.sender, tokenId);

        // Remove listing
        delete listings[tokenId];

        emit NFTSold(tokenId, msg.sender, listing.price);
    }

    // Helper functions
    function _removeTokenFromOwner(address owner, uint256 tokenId) private {
        uint256 length = _ownedTokens[owner].length;
        for (uint256 i = 0; i < length; i++) {
            if (_ownedTokens[owner][i] == tokenId) {
                _ownedTokens[owner][i] = _ownedTokens[owner][length - 1];
                _ownedTokens[owner].pop();
                break;
            }
        }
    }

    function _addTokenToOwner(address owner, uint256 tokenId) private {
        _ownedTokens[owner].push(tokenId);
    }

    // View Functions
    function getTokenURI(uint256 tokenId) public view returns (string memory) {
        return _nfts[tokenId].tokenURI;
    }

    function ownerOf(uint256 tokenId) public view returns (address) {
        return _nfts[tokenId].owner;
    }

    function getOwnedTokens(address owner) public view returns (uint256[] memory) {
        return _ownedTokens[owner];
    }
}

